import { useEffect } from "react";
import { getOrCreateUserId } from "../utils/user";

const ExperimentResult = ({
  quizAnswers,
  readingTime,
  passageText,
  summaryText,
  onBackHome,
}) => {
  // Hooks must be called unconditionally, so move useEffect here:
  useEffect(() => {
    if (!quizAnswers) return; // Guard clause to prevent sending logs with no data

    async function sendLog() {
      const userId = getOrCreateUserId();

      try {
        await fetch('https://read-racer.azurewebsites.net/api/logExperimentResult', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({
            userId,
            useSummary: !!summaryText,
            readingTime,
            realWPM: readingTime && summaryText ? Math.round((summaryText.trim().split(/\s+/).length / readingTime) * 60) : null,
            effectiveWPM: readingTime && passageText ? Math.round((passageText.trim().split(/\s+/).length / readingTime) * 60) : null,
            score: quizAnswers.total?.score ?? 0,
            total: quizAnswers.total?.total ?? ((quizAnswers.mcq?.total ?? 0) + (quizAnswers.saq_laq?.total ?? 0)),
            mcqScore: quizAnswers.mcq?.score ?? 0,
            mcqTotal: quizAnswers.mcq?.total ?? 0,
            saqScore: quizAnswers.saq_laq?.score ?? 0,
            saqTotal: quizAnswers.saq_laq?.total ?? 0
          }),
        });
        console.log("Experiment result logged");
      } catch (err) {
        console.error("Failed to log experiment result:", err);
      }
    }

    sendLog();
  }, [quizAnswers, readingTime, passageText, summaryText]);

  if (!quizAnswers) {
    return (
      <div className="min-h-screen flex items-center justify-center p-6 bg-gray-50">
        <p className="text-gray-600 text-lg">No quiz data found.</p>
      </div>
    );
  }

  const passageWordCount = passageText ? passageText.trim().split(/\s+/).length : 0;
  const summaryWordCount = summaryText ? summaryText.trim().split(/\s+/).length : 0;

  const { total, mcq, saq_laq } = quizAnswers;

  const totalScore = total?.score ?? 0;
  const totalPossible = total?.total ?? ((mcq?.total ?? 0) + (saq_laq?.total ?? 0));

  const realWpm =
    readingTime && summaryWordCount
      ? Math.round((summaryWordCount / readingTime) * 60)
      : null;

  const effectiveWpm =
    readingTime && passageWordCount
      ? Math.round((passageWordCount / readingTime) * 60)
      : null;

  // Points calculation uses effectiveWpm (full passage speed) as before
  const points = totalPossible ? (totalScore / totalPossible) * (effectiveWpm || 0) : 0;

  return (
    <div className="min-h-screen flex items-center justify-center px-4 py-10 bg-gray-50">
      <div className="max-w-md w-full bg-white p-8 rounded-2xl shadow-lg border border-gray-200 text-center">
        <h2 className="text-3xl font-bold text-gray-800 mb-6">Your Results</h2>

        <div className="space-y-3 text-gray-700 text-md">
          <div className="flex justify-between">
            <span>Multiple Choice:</span>
            <span className="font-semibold">
              {mcq?.score ?? 0} / {mcq?.total ?? 0}
            </span>
          </div>

          <div className="flex justify-between">
            <span>Short Answer:</span>
            <span className="font-semibold">
              {saq_laq?.score ?? 0} / {saq_laq?.total ?? 0}
            </span>
          </div>

          <div className="flex justify-between">
            <span>Total Score:</span>
            <span className="font-bold">
              {totalScore} / {totalPossible}
            </span>
          </div>

          {summaryText ? (
            <>
              <div className="flex justify-between">
                <span>Real Reading Speed (summary):</span>
                <span className="font-mono font-semibold">
                  {realWpm !== null ? `${realWpm} WPM` : "N/A"}
                </span>
              </div>
              <div className="flex justify-between">
                <span>Effective Reading Speed (full passage):</span>
                <span className="font-mono font-semibold">
                  {effectiveWpm !== null ? `${effectiveWpm} WPM` : "N/A"}
                </span>
              </div>
            </>
          ) : (
            <div className="flex justify-between">
              <span>Reading Speed:</span>
              <span className="font-mono font-semibold">
                {effectiveWpm !== null ? `${effectiveWpm} WPM` : "N/A"}
              </span>
            </div>
          )}

          <div className="flex justify-between text-lg font-medium text-blue-700 mt-4 border-t pt-4">
            <span>Total Points:</span>
            <span>{points.toFixed(2)}</span>
          </div>
        </div>

        <button
          onClick={onBackHome}
          className="mt-8 w-full px-6 py-3 bg-blue-600 text-white rounded-xl hover:bg-blue-700 transition font-semibold shadow-sm"
        >
          Back to Home
        </button>
      </div>
    </div>
  );
};

export default ExperimentResult;
